import styled from 'styled-components';

export const DivFlex = styled.div `
    display: flex;
    justify-content: center;
    align-itens: center;
`
export const DivText = styled.div`
    display: flex;
    flex-direction: column; 
    align-itens: center;
`
export const Text = styled.p`
    margin-top: 0;
    margin-bottom: 1rem;
    font-size: 1.1rem;
    font-weight: 300;
`
export const Title = styled.h1`
    
`
